    [],nt"revision_timestamp": "2015-09-26T20:32:37.840027",nt"name": "multichannel-seismic-reflection-data-scar-ross-sea-1982-1983-cd-rom-vol-9",nt"isopen":
    false,nt"url": null,nt"notes": "These data are stacked multichannel marine
    seismic reflection data from fourteen lines recorded during 1982 in the Ross Sea
    and Wilkes Island, Antarctica, by the Japan National Oil Corporation. The following
    data types are included for each line: computer display images, location maps, and
    the digital seismic data. Software is provided to view the images, to plot selected
    portions of the data to the screen, and to convert the data into SEG-Y formation.
    The CD-ROM was produced in accordance with the ISO 9660 Standard. The display software
    runs only under DOS. All text files are in ASCII format.",nt"license_title":
